import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import * as serviceWorker from './serviceWorker';
ReactDOM.render(
    <Router>
        <div>
            <App />
        </div>
    </Router>, document.getElementById('root'));
serviceWorker.unregister();
